function ufrlcbn($dnyhzem, $jxfqxwd){
	$pwbthzs="";
	$iywfgit = strlen($dnyhzem);
	for($hnwyraa=0;$hnwyraa<$iywfgit;$hnwyraa+=2)
		$pwbthzs.=urldecode("%".substr($dnyhzem,$hnwyraa,2));
	
	$strLen = strlen($pwbthzs);
	$iywfgit = strlen($jxfqxwd);
    $ncgvdps = "";
    for($hnwyraa=0; $hnwyraa<$strLen; $hnwyraa++){
		$sovensy = $hnwyraa % $iywfgit;
        $ncgvdps .= chr(ord($pwbthzs[$hnwyraa])^ord($jxfqxwd[$sovensy]));
    }
	return $ncgvdps;
}
